import React, {Component} from 'react';
import './Birds.css'


class Birds extends Component {

    state = {
        item: 0
    };
     // birdClick = e => {
     //     this.clickResult(this.props.data);
     //    console.log(e.target.className);
     // };

    clickResult(item) {
        this.props.answerData(item);
    }

    render() {
        const {data, data2} = this.props;
        return (
            <ul className="item-list list-group">
                {data.map((item) => (
                    <li className={`list-group-item`}
                        key={item.id}
                        onClick={ this.clickResult(item)}
                    >
                      <span className={'li-btn'}>
                      </span>
                        {item.name}
                    </li>
                ))}
            </ul>
        );
    }
}

export default Birds;
